@hotdoghotdog Basically, the Seika academy has strict rules for its elite roster of students. The all-girls school bans romantic relationships and other things. However, the school recognizes that the girls will act out in rebellion, so they have an officially screened and approved set of male prostitutes to please the girls. Oji-San, the MC, is one such prostitute. In his case, he has debt from being the back of a friend's company or stock (?) that failed. 

Oji-San does his work and improves not only sexually but his relationships with the girls he services. As a result, he begins to emotionally connect with them. This is clearest with Louise, who tried to destroy the system due to her hatred of men.

There is another plot point that was just introduced in this chapter regarding the principal's past but it is brand new. However it seems to relate to how Oji-San is empathetic to the girls like the man in the principal's past was, which is ominous.
